						["Order"] = 2,
						["Name"] = "CircleTag",
						["Code"] = "local DogTag = LibStub(\"LibDogTag-3.0\")\nlocal L = DogTag.L\n\nDogTag:AddTag(\"Unit\", \"Circle\", {\n        code = TMW.CNDT.Env.Circle,\n        arg = {},\n        ret = \"number\",\n        events = \"Update\",\n        doc = L[\"Return the total number of units in distance\"],\n        example = '[Circle()] => \"2\"',\n        category = L[\"Auras\"]\n})",
					}, -- [1]
					{
						["Name"] = "Circle",
						["Code"] = "local TMW = TMW\nlocal CNDT = TMW.CNDT\nlocal Env = TMW.CNDT.Env\nfunction Env.Circle()\n    local count = 0\n    for i = 1, 40 do\n        local unit = \"nameplate\" .. i\n        if UnitCanAttack(\"player\", unit) and IsItemInRange(63427,unit)  then count = count + 1 end\n    end \n    local start=1\n    for j=1,count do\n        start = start * 0.97\n    end\n    start = max(start,0.5)\n    local ed = (getIntPart((1 - start)*10000))/100\n    return ed..\"%\"\n    \nend\n\nfunction getIntPart(x)\n    if x <= 0 then\n        return math.ceil(x);\n    end\n    \n    if math.ceil(x) == x then\n        x = math.ceil(x);\n    else\n        x = math.ceil(x) - 1;\n    end\n    return x;\nend",
